import React, { Component } from "react";

class Title extends Component {
  render() {
    return (
      <div className={"d-inline-flex p-2"}>
        <h1 className={"ml-5 mt-4 b"}>Robots </h1>
        <button className={"btn btn-primary btn-sm mr-lg-2"} style={
          {height: "10%",width: "30%"}
        }>Add Robot</button>
      </div>
    );
  }
}

export default Title;
